css:
:host,
.atom-text-editor {
  background-color: #f7f7f7;
  color: #745ad9;
}
:host,
.atom-text-editor {
  background-color: #f7f7f7;
  color: #745ad9;
}
:host .wrap-guide,
.atom-text-editor .wrap-guide {
  background-color: #ffffff;
}
:host .indent-guide,
.atom-text-editor .indent-guide {
  color: #ffffff;
}
:host .invisible-character,
.atom-text-editor .invisible-character {
  color: rgba(157, 157, 157, 0.6);
}
:host .gutter,
.atom-text-editor .gutter {
  background-color: #eaeaea;
  color: #745ad9;
}
:host .gutter .line-number.cursor-line,
.atom-text-editor .gutter .line-number.cursor-line {
  background-color: #ffffff;
  color: #e729a0;
}
:host .gutter .line-number.cursor-line-no-selection,
.atom-text-editor .gutter .line-number.cursor-line-no-selection {
  color: #e729a0;
}
:host .gutter .line-number.folded,
.atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number:after,
.atom-text-editor .gutter .line-number:after,
:host .fold-marker:after,
.atom-text-editor .fold-marker:after {
  color: rgba(157, 157, 157, 0.6);
}
:host .invisible,
.atom-text-editor .invisible {
  color: #745ad9;
}
:host .cursor,
.atom-text-editor .cursor {
  color: #262536;
}
:host .selection .region,
.atom-text-editor .selection .region {
  background-color: rgba(255, 246, 84, 0.9);
}
.atom-text-editor .search-results .marker .region {
  background-color: transparent;
  border: 2px solid rgba(157, 157, 157, 0.6);
}
.atom-text-editor .search-results .marker.current-result .region {
  border: 2px solid #ffffff;
}
.comment {
  color: rgba(157, 157, 157, 0.6);
}
.entity.name.type {
  color: #745ad9;
}
.entity.other.inherited-class {
  color: #262536;
}
.keyword {
  color: #c7425e;
}
.keyword.control {
  color: #c7425e;
}
.keyword.operator {
  color: #ec57b4;
}
.keyword.other.special-method {
  color: #262536;
}
.keyword.other.unit {
  color: #e729a0;
}
.storage {
  color: #25b7b8;
}
.constant {
  color: #e729a0;
}
.constant.character.escape {
  color: #25b7b8;
}
.constant.numeric {
  color: #e729a0;
}
.constant.other.color {
  color: #25b7b8;
}
.constant.other.symbol {
  color: #e729a0;
}
.variable {
  /* color: lighten(@orange, 15%); */
  color: #7c289d;
}
.variable.interpolation {
  color: #820f57;
}
.variable.parameter.function {
  color: #c7425e;
}
.invalid.illegal {
  background-color: #e7143c;
  color: #f7f7f7;
}
.string {
  color: #262536;
}
.string.regexp {
  color: #25b7b8;
}
.string.regexp .source.ruby.embedded {
  color: #e729a0;
}
.string.other.link {
  color: #e7143c;
}
.punctuation.definition.comment {
  color: rgba(157, 157, 157, 0.6);
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #c7425e;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #25b7b8;
}
.punctuation.definition.bold {
  color: #745ad9;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #c7425e;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #b81030;
}
.support.class {
  color: #745ad9;
}
.support.function {
  color: #7c289d;
}
.support.function.any-method {
  color: #c7425e;
}
.entity.name.function {
  color: #262536;
}
.entity.name.class,
.entity.name.type.class {
  color: #e729a0;
}
.entity.name.section {
  color: #262536;
}
.entity.name.tag {
  color: #c7425e;
}
.entity.other.attribute-name {
  color: #e729a0;
}
.entity.other.attribute-name.id {
  color: #262536;
}
.meta.class {
  color: #745ad9;
}
.meta.link {
  color: #e729a0;
}
.meta.require {
  color: #262536;
}
.meta.selector {
  color: #c7425e;
}
.meta.separator {
  background-color: rgba(157, 157, 157, 0.6);
  color: #745ad9;
}
.none {
  color: #745ad9;
}
.markup.bold {
  color: #e729a0;
  font-style: bold;
}
.markup.changed {
  color: #c7425e;
}
.markup.deleted {
  color: #e7143c;
}
.markup.italic {
  color: #7c289d;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #25b7b8;
}
.markup.inserted {
  color: #262536;
}
.markup.list {
  color: #e729a0;
}
.markup.quote {
  color: #e7143c;
}
.markup.raw.inline {
  color: #262536;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #262536;
}
.atom-text-editor[mini] .scroll-view {
  padding-left: 1px;
}
